import React from "react";
import {Button, Card, Col, Form, Alert} from "react-bootstrap";
import axios from "axios";

class StartStream extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            description:'',
            tag:'',
            title:'',
            userId: ''
        }
        this.valueChange = this.valueChange.bind(this)
        this.submitChange = this.submitChange.bind(this)


    }

    valueChange  (event){
        this.setState({
            [event.target.name]:event.target.value
        })
    }
    submitChange (event) {


        if(this.state.newPass===this.state.newPassRep)
            axios({
                method:'put',
                url:'http://localhost:8080/putPassword?newPass='
                    +this.state.newPass
                    +'&oldPass='
                    +this.state.oldPass
                    +'&userId='
                    +this.state.userId,
            }).then(response => response.data)
                .then((data) =>{
                    this.setState({returnString: data});
                    alert(this.state.returnString)
                    if(this.state.returnString ===0)
                        window.location = "/"+this.state.userType+"/profil";
                });


        this.forceUpdate();
        event.preventDefault();
    }


    render() {
        return(
            <Card className="border border-light bg-light text-black">
                <Form  onSubmit={this.submitSearch}>
                    <Card.Body>
                        <Form.Row>
                            <Form.Group as={Col}>
                                <Form.Label>Tytuł strumienia</Form.Label>
                                <Form.Control
                                    required
                                    type="text"
                                    autoComplete={"off"}
                                    name={"title"}
                                    value={this.state.title}
                                    onChange={this.valueChange}
                                    placeholder="title"
                                    className={"bg-light text-black"}
                                />
                            </Form.Group>
                        </Form.Row>
                        <Form.Row>
                            <Form.Group as={Col}>
                                <Form.Label>Opis strumienia</Form.Label>
                                <Form.Control
                                    as="textarea"
                                    rows={3}
                                    required
                                    type="text"
                                    autoComplete={"off"}
                                    name={"description"}
                                    value={this.state.description}
                                    onChange={this.valueChange}
                                    placeholder="description"
                                    className={"bg-light text-black"}
                                />
                            </Form.Group>
                        </Form.Row>
                        <Form.Row>
                            <Form.Group as={Col}>
                                <Form.Label>Opis strumienia</Form.Label>
                                <Form.Control
                                    as="select"
                                    required
                                    autoComplete={"off"}
                                    name={"tag"}
                                    value={this.state.tag}
                                    onChange={this.valueChange}
                                    className={"bg-light text-black"}
                                >
                                    <option>PEGI8</option>
                                    <option>PEGI10</option>
                                    <option>PEGI12</option>
                                    <option>PEGI16</option>
                                    <option>PEGI18</option>
                                </Form.Control>
                            </Form.Group>
                        </Form.Row>
                    </Card.Body>
                    <Card.Footer>
                        <div >
                            <Button size="sm" variant="success" type="submit" style={{"textAlign":"center"}}>
                                Rozpocznij
                            </Button>{" "}
                        </div>
                    </Card.Footer>

                </Form>
            </Card>
        );
    }

}



export default StartStream;
